import Playlist from './Playlist'

const Playlists = ({ url, playlists, deletePlaylist }) => {

    return (
      <div>
        <ul>
          { playlists.map(playlist => (
            <Playlist url={url} playlist={playlist} deletePlaylist={deletePlaylist} />
          )) }
        </ul>
      </div>
    )
  }

